      out.write("function createCashFlow(data){\r\n");
      out.write("    var total = \"0\";\r\n");
      out.write("    var htmlContent = \"\";\r\n");
      out.write("    for(var i = 0; i < data.length; i++) {\r\n");
      out.write("        htmlContent += \"<tr><td>\" + (parseInt(i) + 1) + \"</td>\";\r\n");
      out.write("        //最小支付日赋值\r\n");
      out.write("        if (i == 0) {\r\n");
      out.write("            cashFlowMixPayDate = data[i].repaymentDate;\r\n");
      out.write("\t\t}\r\n");
      out.write("        //支付日\r\n");
      out.write("        htmlContent += \"<td>\" + (data[i].repaymentDate == null ? '' : data[i].repaymentDate) + \"</td>\";\r\n");
      out.write("        //应还本金\r\n");
      out.write("        var rePaymentAmount = data[i].repaymentAmount;\r\n");
      out.write("        htmlContent += \"<td>\" + (rePaymentAmount == null ? '' : rePaymentAmount) + \"</td>\";\r\n");
      out.write("        //应还本金之和\r\n");
      out.write("        total = eval(parseInt(total) + rePaymentAmount);\r\n");
      out.write("        //应还利息\r\n");
      out.write("        htmlContent += \"<td>\" + (data[i].repaymentInterest == null ? '' : data[i].repaymentInterest) + \"</td>\";\r\n");
      out.write("        //应还费用\r\n");
      out.write("        htmlContent += \"<td>\" + (data[i].repaymentCost == null ? '' : data[i].repaymentCost) + \"</td></tr>\";\r\n");
      out.write("    }\r\n");
      out.write("    //总费用\r\n");
      out.write("    cashFlowTotalCost = total;\r\n");
      out.write("    return htmlContent;\r\n");
      out.write("}\r\n");
