      out.write("/**\r\n");
      out.write(" * 现金流校验\r\n");
      out.write(" * 最小支付日大于等于投放日期\r\n");
      out.write(" * 债权本金等于应还本金之和\r\n");
      out.write(" */\r\n");
      out.write("function validateCashFlowLimit() {\r\n");
      out.write("    var flag = false;\r\n");
      out.write("    //投放日期\r\n");
      out.write("\tvar putDate = $(\"#putDate\").val();\r\n");
      out.write("\tvar putDateArr = putDate.split(\"-\");\r\n");
      out.write("\tvar payDateArr = cashFlowMixPayDate.split(\"-\");\r\n");
      out.write("\t//去掉数字首位0\r\n");
      out.write("\tvar regex=/^[0]+/\r\n");
      out.write("\tif (putDateArr.length == 3 && payDateArr.length == 3) {\r\n");
      out.write("\t\tvar year = putDateArr[0];\r\n");
      out.write("\t\tvar month = putDateArr[1].replace(regex, \"\");\r\n");
      out.write("\t\tvar day = putDateArr[2].replace(regex, \"\");\r\n");
      out.write("\t\tvar payYear = payDateArr[0];\r\n");
      out.write("\t\tvar payMonth = payDateArr[1].replace(regex, \"\");\r\n");
      out.write("\t\tvar payDay = payDateArr[2].replace(regex, \"\");\r\n");
      out.write("\t\tif (payYear > year) {\r\n");
      out.write("\t\t\tflag = true;\r\n");
      out.write("\t\t} else if (payYear == year) {\r\n");
      out.write("\t\t\tif (payMonth > month) {\r\n");
      out.write("\t\t\t\tflag = true;\r\n");
      out.write("\t\t\t} else if (payMonth == month) {\r\n");
      out.write("\t\t\t\tif (payDay >= day) {\r\n");
      out.write("\t\t\t\t\tflag = true;\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t}\r\n");
      out.write("\t}\r\n");
      out.write("\r\n");
      out.write("\t//债权本金等于应还本金\r\n");
      out.write("\tif (flag) {\r\n");
      out.write("        if ($(\"#bondPrincipal\").val() != cashFlowTotalCost) {\r\n");
      out.write("            flag = false;\r\n");
      out.write("            alert(\"应还本金之和与债权本金应相等\");\r\n");
      out.write("        }\r\n");
      out.write("\t} else {\r\n");
      out.write("\t    alert(\"首次支付日应大于等于投放日期\");\r\n");
      out.write("\t}\r\n");
      out.write("\r\n");
      out.write("\treturn flag;\r\n");
      out.write("}\r\n");
      out.write("/**\r\n");
      out.write(" * 校验金额或者百分数\r\n");
      out.write(" */\r\n");
      out.write("function validateMoneyOrNumber(obj, isMoney) {\r\n");
      out.write("    //正则表达式\r\n");
      out.write("    var reg = \"\";\r\n");
      out.write("    if (isMoney) {\r\n");
      out.write("        //金额正则\r\n");
      out.write("        reg = /(^[1-9]([0-9]+)?(\\.[0-9]{1,2})?$)|(^(0){1}$)|(^[0-9]\\.[0-9]([0-9])?$)|(^[-][1-9]([0-9]+)?(\\.[0-9]{1,2})?$)|(^[-][0-9]\\.[0-9]([0-9])?$)/;\r\n");
      out.write("\t} else {\r\n");
      out.write("        //百分数正则\r\n");
      out.write("        reg = /(^[1-9]([0-9]+)?(\\.[0-9]{1,2})?$)|(^[0](\\.[0-9]{1,2})?$)|(^(1){1}(0){2}$)/;\r\n");
      out.write("        if (obj == \"0.0\" || obj == \"0.00\") {\r\n");
      out.write("            return \"\";\r\n");
      out.write("        }\r\n");
      out.write("\t}\r\n");
      out.write("\t//return value\r\n");
      out.write("\tif(reg.test(obj)){\r\n");
      out.write("        //填写内容通过，如果有err，remove\r\n");
      out.write("        $(obj).next(\"p\").hide();\r\n");
      out.write("        return obj;\r\n");
      out.write("\t}else{\r\n");
      out.write("        return \"\";\r\n");
      out.write("\t}\r\n");
      out.write("}\r\n");
